class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        if not s:
            return True
        if not t:
            return False
        ps = 0
        pt = 0
        ns = len(s)
        nt = len(t)
        while ps < ns:
            while s[ps] != t[pt]:
                pt += 1
                if pt >= nt:
                    return False
            pt += 1
            ps += 1
        return ps >= ns

s = Solution()
print(s.isSubsequence("leeeeetcode",
""))